    min_moves = float('inf')
    divisible_by_25 = False

    def is_divisible_by_25(number: int) -> bool:
        return number % 25 == 0

    def has_leading_zero(number: int) -> bool:
        return int(str(number)[0]) == 0

    def get_next_numbers(number: int, digit_index: int) -> list:
        if digit_index == len(original_digits) - 1:
            return []
        next_digits = original_digits.copy()
        next_digits[digit_index], next_digits[digit_index + 1] = next_digits[digit_index + 1], next_digits[digit_index]
        return [int(''.join(map(str, next_digits)))]

    def backtrack(number: int, digit_index: int, moves: int):
        nonlocal min_moves, divisible_by_25
        if is_divisible_by_25(number):
            min_moves = min(min_moves, moves)
            divisible_by_25 = True
            return
        if has_leading_zero(number) or moves >= min_moves:
            return
        for next_number in get_next_numbers(number, digit_index):
            backtrack(next_number, digit_index + 1, moves + 1)

    backtrack(n, 0, 0)

    return str(min_moves) if divisible_by_25 else '-1'

