def solution(stdin: str) -> str:
    n, m = map(int, stdin.readline().split())
    grid = [list(stdin.readline().strip()) for _ in range(n)]

    def is_valid(x: int, y: int, size: int) -> bool:
        if x < 0 or x >= n or y < 0 or y >= m:
            return False
        for i in range(max(0, x - size), min(n, x + size + 1)):
            for j in range(max(0, y - size), min(m, y + size + 1)):
                if grid[i][j] == '*':
                    return False
        return True

    def helper(x: int, y: int, size: int) -> bool:
        if not is_valid(x, y, size):
            return False
        if size == 0:
            return True
        for i in range(x - size, x + size + 1):
            for j in range(y - size, y + size + 1):
                if i == x and j == y:
                    continue
                if grid[i][j] == '*':
                    grid[i][j] = '.'
                    if helper(i, j, size - 1):
                        return True
                    grid[i][j] = '*'
        return False

    stars = []
    for i in range(n):
        for j in range(m):
            if grid[i][j] == '*':
                grid[i][j] = '.'
                size = 1
                while True:
                    if helper(i, j, size):
                        stars.append((i, j, size))
                        break
                    size += 1
                grid[i][j] = '*'

    if len(stars) > n * m:
        return "-1"

    output = [str(len(stars))] + [" ".join(map(str, star)) for star in stars]
    return "\n".join(output)

