    def kruskal(n, a, offers):
        edges = []
        for i in range(n):
            for j in range(i + 1, n):
                if i != j:
                    if offers:
                        edges.append((a[i] + a[j], i, j, min(offers, key=lambda x: x[3] if x[1] == i and x[2] == j else float('inf'))))
                    else:
                        edges.append((a[i] + a[j], i, j))
        edges.sort()

        parent = list(range(n))
        rank = [0] * n
        def find(x):
            if parent[x] != x:
                parent[x] = find(parent[x])
            return parent[x]

        def union(x, y):
            px, py = find(x), find(y)
            if px == py:
                return False
            if rank[px] > rank[py]:
                parent[py] = px
            else:
                parent[px] = py
                if rank[px] == rank[py]:
                    rank[py] += 1
            return True

        cost = 0
        for edge in edges:
            if union(edge[1], edge[2]):
                cost += edge[0]
        return cost

    return str(kruskal(n, a, offers))

