    def kruskal(n, edges):
        parent = [i for i in range(n)]
        rank = [0] * n
        def find(u):
            if u == parent[u]:
                return u
            parent[u] = find(parent[u])
            return parent[u]
        def union(u, v):
            u = find(u)
            v = find(v)
            if u == v:
                return False
            if rank[u] < rank[v]:
                parent[u] = v
            else:
                parent[v] = u
                if rank[u] == rank[v]:
                    rank[u] += 1
            return True
        mst = []
        for e in sorted(edges, key=lambda x: x[2]):
            if union(e[0]-1, e[1]-1):
                mst.append(e)
        return mst

    def to_graph(n, edges):
        graph = [[] for _ in range(n)]
        for e in edges:
            u, v = e[0]-1, e[1]-1
            graph[u].append(v)
            graph[v].append(u)
        return graph

    def dfs(graph, start, visited=None):
        if visited is None:
            visited = [False] * len(graph)
        visited[start] = True
        for v in graph[start]:
            if not visited[v]:
                dfs(graph, v, visited)
        return visited

    def max_degree(n, edges):
        graph = to_graph(n, edges)
        visited = dfs(graph, 0)
        degrees = [len(graph[i]) for i in range(n) if visited[i]]
        return max(degrees)

    def get_spanning_tree(n, edges):
        mst = kruskal(n, edges)
        graph = to_graph(n, mst)
        visited = dfs(graph, 0)
        spanning_tree = [e for e in mst if visited[e[0]-1] and visited[e[1]-1]]
        return spanning_tree

