    def is_lexicographically_less(p: List[int], q: List[int]) -> bool:
        for i in range(len(p)):
            if i == len(q) or p[i] != q[i]:
                return p[i] < q[i] if i < len(q) else True
        return len(p) < len(q)

    def next_permutation(p: List[int]) -> List[int]:
        i = len(p) - 2
        while i >= 0 and p[i] >= p[i + 1]:
            i -= 1
        if i < 0:
            return []
        j = len(p) - 1
        while p[j] <= p[i]:
            j -= 1
        p[i], p[j] = p[j], p[i]
        p[i + 1:] = reversed(p[i + 1:])
        return p

    def find_minimum_permutation(p: List[int], operations: int) -> List[int]:
        min_permutation = p
        for _ in range(operations):
            next_p = next_permutation(min_permutation)
            if not next_p:
                break
            if is_lexicographically_less(next_p, min_permutation):
                min_permutation = next_p
        return min_permutation

    def process_test_case(n: int, p: List[int], operations: int) -> List[int]:
        return find_minimum_permutation(p, operations)

