        i, j = k, n
        while i > 0 and j > 0:
            if dp[i][j] == dp[i][j - 1]:
                i, j = i, j - 1
            else:
                subsegments.append(j)
                i, j = i - 1, j - 1

        subsegments.append(0)
        subsegments.reverse()
        return subsegments

