    key_phrase, plain_text = stdin.split('\n')
    key_phrase = key_phrase.replace(' ', '')
    key = [c for c in key_phrase.lower() if c != 'q']
    for c in 'abcdefghijklmnoprstuvwxyz':
        if c not in key and c != 'q':
            key.append(c)

    key = ''.join(key)
    key = [list(key[i:i + 5]) for i in range(0, len(key), 5)]

    def find_coordinates(char: str) -> tuple:
        for i, row in enumerate(key):
            if char in row:
                return (i, row.index(char))

    def encrypt(pair: str) -> str:
        a, b = pair
        if a == b:
            return 'X' + a

        a_x, a_y = find_coordinates(a)
        b_x, b_y = find_coordinates(b)

        if a_x == b_x:
            return key[a_x][(a_y + 1) % 5] + key[b_x][(b_y + 1) % 5]
        elif a_y == b_y:
            return key[(a_x + 1) % 5][a_y] + key[(b_x + 1) % 5][b_y]
        else:
            return key[a_x][b_y] + key[b_x][a_y]

    encrypted_text = ''
    i = 0
    while i < len(plain_text):
        pair = plain_text[i:i + 2]
        encrypted_text += encrypt(pair)
        i += 2

    return encrypted_text.upper()

