    sorted_s = sorted(enumerate(s), key=lambda x: x[1])
    max_exams = sum(s)
    exam_pile = [0] * n
    visited = [False] * n

    def is_safe(room):
        return exam_pile[room] >= s[room]

    def redistribute_exams():
        for room in range(n):
            if not visited[room]:
                if not is_safe(room):
                    return False
                exam_pile[room] -= s[room]
                visited[room] = True
        return True

    def backtrack(start):
        if start == n:
            return True
        for i in range(start, n):
            if not visited[i]:
                if sum(exam_pile) < max_exams - exam_pile[i] - s[i]:
                    continue
                exam_pile[i] += s[i]
                visited[i] = True
                if backtrack(start + 1):
                    return True
                exam_pile[i] -= s[i]
                visited[i] = False
        return False

    if sum(s) % 2 == 1:
        return "impossible"

    if redistribute_exams():
        for room in range(n):
            if not visited[room]:
                exam_pile[room] += s[room]
                visited[room] = True
                if backtrack(0):
                    return " ".join(str(i[0] + 1) for i in sorted_s)
                exam_pile[room] -= s[room]
                visited[room] = False

    return "impossible"

